script: |
  super -f text -I q10236.spq | sort > q10236.out

inputs:
  - name: q10236.spq
    data: |
      SELECT DISTINCT 12 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE + col0 + 81 IS NULL OR NOT + col1 BETWEEN ( col0 * col1 + + col0 ) AND NULL;
  - name: tab0

outputs:
  - name: q10236.out
    data: |
      12
